import React from 'react';
import {  Link } from "react-router-dom";
// import Mainpage from "../pages/Mainpage";

const Navbar= () =>{
    return (
        <nav>
            <div>
                <li><Link to="/">Mainpage</Link></li>
                <li><Link to="/setting">Setting</Link></li>
            </div>
        </nav>
    );
}
export default Navbar;
